import React, { Component } from "react";

class Sitzverteilung extends Component {
  state = {
    url: "http://localhost:8000/query1_chart",
  };
  render() {
    return (
      <React.Fragment>
        <h2 style="margin-left: 2em;margin-top: 3em;">Sitzverteilung</h2>
        <div style="width: 900px; height: 500px;">
          <img src={this.state.url} />
        </div>
        <table style="table-layout: fixed;width: 30%; border-collapse: collapse; border: 1px solid rgb(17, 198, 44); text-align: center;"></table>
      </React.Fragment>
    );
  }
}

export default Sitzverteilung;
